import React from 'react';


function Header() {
return (
	<div className="Header">
		<div className="logo">
		LOGO
		</div>
		
		<nav>
			<ul>
				<li>
					<a href="#"></a>
				</li>
			</ul>
		</nav>
	</div>
);
}

export default Header;
